import { Mongoose } from "mongoose";

const { String } =Mongoose.Schema.Types;

const productSchema = new Mongoose.Schema({
    name: {
        type: String,
        reqired: true
    },
    price: {
        type: Number,
        required: true
    },
    sku: {
        type: String,
        unique: true
    },
    description: {
        type: String,
        required: true
    },
    mediaUrl: {
        type: String,
        required: true
    }
})
